// import "./App.css";
import { useState, useEffect } from "react";

function App() {
  const [data, setData] = useState([]);

  //https://hacker-news.firebaseio.com/v0/item/12.json?print=pretty

  useEffect(() => {
    fetch(
      `https://hacker-news.firebaseio.com/v0/item/12.json?print=pretty`
    ).then((response) => {
      response.json().then((result) => setData(result));
    });
  });
  return <div className="App"></div>;
}

export default App;
